import React, { useState } from "react";
import Square from "./Square";
import { Tile } from "../Types";

interface RowProps {
  row: Tile[];
}

function Row({ row }: RowProps) {
  return (
    <div>
      {row.map((square, index) => (
        <Square key={index} square={square} />
      ))}
    </div>
  );
}

export default Row;
